import { connect, waitForPageLoad } from "@/client.js";

const client = await connect("http://localhost:9222");
const page = await client.page("main");

// Function to add a game with rating 9
async function addGameWithRating9(searchTerm: string, gameIndex: number = 0) {
  console.log(`\n--- Adding: ${searchTerm} ---`);

  // Clear the search and type new term
  await page.fill('input[role="combobox"]', '');
  await page.fill('input[role="combobox"]', searchTerm);
  await page.waitForTimeout(1500);

  // Click on the specified game result
  const options = page.locator('[role="option"]');
  const count = await options.count();
  console.log(`Found ${count} search results`);

  if (count > gameIndex) {
    await options.nth(gameIndex).click();
    await page.waitForTimeout(1000);

    // Set rating to 9
    const slider = page.locator('[role="slider"]');
    await slider.focus();

    // Get current value and adjust to 9
    const currentValue = parseInt(await slider.getAttribute('aria-valuenow') || '5');
    const adjustment = 9 - currentValue;

    for (let i = 0; i < Math.abs(adjustment); i++) {
      if (adjustment > 0) {
        await page.keyboard.press('ArrowRight');
      } else {
        await page.keyboard.press('ArrowLeft');
      }
    }

    await page.waitForTimeout(200);
    const newValue = await slider.getAttribute('aria-valuenow');
    console.log(`Rating set to: ${newValue}`);

    // Click Confirm Entry
    await page.click('button:has-text("Confirm Entry")');
    await page.waitForTimeout(1500);

    console.log(`Added ${searchTerm} successfully!`);
    return true;
  }
  return false;
}

// Add 4 more games (we already added 1)
const games = ['Mario', 'Metroid', 'Halo', 'Pokemon'];

for (const game of games) {
  await addGameWithRating9(game);
}

// Take a final screenshot
await page.screenshot({ path: "tmp/after-all-games.png" });

console.log("\n--- Final State ---");
console.log("URL:", page.url());

await client.disconnect();
EOF

